import React, {Component} from "react";
import {withRouter} from "react-router-dom";

class Videoschool extends Component {
    constructor() {
        super();
        this.state = {}
    }

    add=()=>{
        this.props.history.push("/video")
    }
    render(){
        return(<div className={"Videoschool"}>
            <img alt={"标本"} onClick={this.add} className={"addtoimg"} src={"/img/Fkpdn7F9EWxvNeSS8M7V4_xbRPlf?50X50&imageView2/1/w/50/h/50"}/>
            <br/>
            <span>视频圈</span>
        </div>)
    }
}

export default withRouter(Videoschool);
